import React from 'react';
import Bio from '../components/Bio';

const Team = () => (
  <div className="biocard">
    <Bio user={{name: "Dr. Christina Murray, O.D.", role: "Doctor", bio: "Lorem ipsum dolor sit amet, consectetur adipisicing elit. Eligendi non quis exercitationem culpa nesciunt nihil aut nostrum explicabo reprehenderit optio amet ab temporibus asperiores quasi cupiditate. Voluptatum ducimus voluptates voluptas?", url: "/images/ChristinaMurray.jpeg"}}/>
  </div>
);

export default Team;
